package com.jun.study.leetcode.google.day25;

import java.util.HashMap;
import java.util.Map;

public class NumberOfMatchingSubsequences {
    public int numMatchingSubseq(String s, String[] words) {
        Map<String, Integer> result = new HashMap<>();
        int totalMatching = 0;
        for (int i = 0; i < words.length; i++) {
            if (result.containsKey(words[i])) {
                totalMatching += result.get(words[i]);
            } else {
                int ok = isMatching(s, words[i]);
                result.put(words[i], ok);
                totalMatching += ok;
            }
        }
        return totalMatching;

    }

    public int isMatching(String t, String s) {
        if (t == null || s.length() > t.length())
            return 0;
        int i = 0;
        for (int j = 0; i < s.length() && j < t.length(); j++) {
            if (s.charAt(i) == t.charAt(j)) {
                i++;
            }
        }
        return i == s.length()?1:0;
    }

    private int isMatching3(String s, String word) {
        int k = 0;
        for (int i = 0; i < word.length(); i++) {
            char ch = word.charAt(i);
            boolean isFound = false;
            int j = k;
            for (; j < s.length(); j++) {
                char sCh = s.charAt(j);
                if (sCh == ch) {
                    isFound = true;
                    break;
                }
            }
            if (!isFound) {
                return 0;
            }
            if (i < word.length() && j == s.length()) {
                return 0;
            }
            k = j+1;


        }
        return 1;
    }


    private int isMatching2(String s, String word) {
        if (s.length() < word.length()) {
            return 0;
        }

        int row = s.length();
        int col = word.length();
        int[][] dp = new int[row+1][col+1];
        for (int i = 1; i <= row; i++) {
            char rowCh = s.charAt(i-1);
            for (int j = 1; j <= col; j++) {
                char colCh = word.charAt(j-1);
                if (rowCh == colCh) {
                    dp[i][j] = dp[i-1][j-1] +1;
                } else {
                    dp[i][j] = Math.max(dp[i-1][j], dp[i][j-1]);
                }
            }
        }
        int maxCommonSubSequences = dp[row][col];
        if (maxCommonSubSequences == word.length()) {
            return 1;
        }

        return 0;

     }

    public static void main(String[] args) {
        String s = "";
        String[] words = {"vm","vn","acd","ace"};
        NumberOfMatchingSubsequences numberOfMatchingSubsequences = new NumberOfMatchingSubsequences();
        System.out.println("number=" + numberOfMatchingSubsequences.numMatchingSubseq(s, words));
    }
}
